import React from 'react';
import { useDispatch } from 'react-redux';
import { useEffect } from 'react';

const User = ({ userData }) => {
    const dispatch = useDispatch();

    useEffect(() => {
        dispatch({
            type: 'CLEAR_USER_DATA',
        });
        dispatch({
            type: 'SET_USER_DATA',
            payload: 'dafault',
        });
    }, [dispatch]);

    return (
        <div className="data">
            <p>{userData.payload}</p>
        </div>
    );
};

export default User;
